import React from "react";
import styled from "styled-components";
import { StyledModal } from "./Modal";

const WarningdModal = styled(StyledModal)`
  background-color: rgba(152, 149, 136, 0.7);
`;

export const WarningMessage: React.FC = () => {
  return (
    <WarningdModal handleClose={() => console.log("close modal")}>
      <h5>Warning</h5>
    </WarningdModal>
  );
};
